import './Login.css';

function Login(){
    return (
        <div className="login">
            <img 
            src="https://storage.googleapis.com/pr-newsroom-wp/1/2018/11/Spotify_Logo_RGB_Green.png" />
            <button>Login</button>
        </div>
    )
}

export default Login
